import { Link } from 'react-router-dom';
const DUMMY_EVENTS = [
    {
      id: 'e1',
      title: 'Some event',
    },
    {
      id: 'e2',
      title: 'Another event',
    },
  ];

function EditEventPage() {
    return (
        <>
            <h1>Edit Event Page</h1>

            {DUMMY_EVENTS.map((event) => (
                <li key={event.id} >
                    <Link to = {event.id} >{event.title}</Link>
                </li>
            ))}
        </>
    )
}

export default EditEventPage;
